import closeIcon from '../../images/closeIcon.png'

interface RegistrationFormProps {
    option: string
    setOption: React.Dispatch<React.SetStateAction<string|null>>
}

function RegistrationForm({option = "user", setOption}: RegistrationFormProps) {
  return (
      <div>
          <img src={closeIcon} alt='Close' className='close-icon' data-testid={"upload-close"} onClick={() => setOption(null)} />
          
      </div>
  )
}

export default RegistrationForm
